import React from 'react';


class Finder extends React.Component {

    render() {
        return (
            <form id="finder">
                <input 
                    type="text" 
                    id="finderInput" 
                    placeholder="Input Room Number you want to find"
                    value={this.props.findRoomId} 
                    onChange={this.props.handleChangeFinder}
                />
                <input 
                    type="submit" 
                    id="finderSubmit" 
                    value="Find Room Id" 
                />
            </form>)
    }
}

export default Finder
